Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;
X轴追踪移动 = _root.敌人二级函数.X轴追踪移动;
Z轴追踪移动 = _root.敌人二级函数.Z轴追踪移动;

function 弧光斩旋转()
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = "";
	子弹属性.霰弹值 = 9;
	子弹属性.子弹散射度 = 1;
	子弹属性.子弹种类 = "近战联弹";
	子弹属性.子弹威力 = _parent.空手攻击力;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 5;

	子弹属性.最小霰弹值 = 3;

	子弹属性.伤害类型 = "魔法";
	//子弹属性.魔法伤害属性 = "能";

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}

function 弧光斩纵劈()
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 1;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 = _parent.空手攻击力 * 5;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;

	子弹属性.伤害类型 = "魔法";
	//子弹属性.魔法伤害属性 = "能";

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}

距离X = _root.gameworld[_parent.攻击目标]._x - _parent._x;
if (距离X > 0)
{
	_parent.方向改变("右");
}
else
{
	_parent.方向改变("左");
}

onClipEvent (load) {
	距离乘数 = 15;
}
onClipEvent (enterFrame) {
	if (距离乘数 > 0)
	{
		_parent.X轴追踪移动(100,-距离乘数,距离乘数 * 2);
		_parent.Z轴追踪移动(距离乘数);
		距离乘数 -= 3;
	}
}

onClipEvent (enterFrame) {
	//_parent.攻击时移动(40);
	_parent.X轴追踪移动(0,10,40);
	_parent.Z轴追踪移动(5);
}
